import React from 'react';
import { Link } from "react-router-dom"
import BootstrapCard from 'react-bootstrap/Card';


export const Card = ({ listTodos }) => {
    return(
        <>
            {listTodos.map(todo => {
                return(

                    <ul key={todo.id}>
                        <li>
                            <Link to={`${todo.id}`}>{todo.content}</Link>
                        </li>
                    </ul>
                )
            })}
        </>
    )
}
